import React from 'react';
import { Parallax } from 'react-scroll-parallax'

function Header() {
    return (
        <div className={style.root}>
        <span className={`${style.copy} h1`}>
            {copy.map((letter, i) => (
                <Parallax
                    key={`copy-${i}`}
                    offsetXMax={100 * (i - 3)}
                    className={style.letter}
                >
                    {letter}
                </Parallax>
            ))}
        </span>
    </div>
    );
}

export default Header;
